import { StyledNav } from "./styles/Nav.styled";
import avatarIcon from "../assets/avatarIcon.svg";

const Nav = () => {
  return (
    <StyledNav>
      <p>Projects</p>
      <img src={avatarIcon} alt="" />
      <p>About</p>
      <p>Resume</p>
      <p>Contact</p>
    </StyledNav>
  );
};

export default Nav;
